import React from 'react';

import UsersList from '../components/UsersList';

const Users = () => {
  const USERS = [
    {
      id: 'u1',
      name: 'Eren',
      image: 'https://www.google.com/imgres?imgurl=https%3A%2F%2Ffikirturu.com%2Fwp-content%2Fuploads%2F2023%2F05%2F260520231-1080x720.jpg&tbnid=D0l7H6EYRcWRiM&vet=12ahUKEwiDzp7lzsOCAxX1mf0HHZWXDjwQMygDegQIARBF..i&imgrefurl=https%3A%2F%2Ffikirturu.com%2Fspor%2Fmauro-icardi-gecmisi-olmayan-adam%2F&docid=_zzZkI_j84RbyM&w=1080&h=720&q=İcardi&client=safari&ved=2ahUKEwiDzp7lzsOCAxX1mf0HHZWXDjwQMygDegQIARBF',
      songs: 3
    }
  ]


  return <UsersList items={USERS}/>;
};

export default Users;
